mapper.select:
      select count(*) from tticket
	     where 1=1
	      
	        and fs_no = #{fsNo}
	      
	      
	        and fs_ScenicNo = #{fsScenicno}
	      
	      
	        and fs_Name like '%'||#{fsName}||'%'
	      
	      
	        and fs_Type = #{fsType}
	      
	      
	        and fi_Stat = #{fiStat}

      select * from (select ROWNUM as rowno, t.* from tticket t
    	where 1=1
	      
	        and fs_no = #{fsNo}
	      
	      
	        and fs_ScenicNo = #{fsScenicno}
	      
	      
	        and fs_Name like '%'||#{fsName}||'%'
	      
	      
	        and fs_Type = #{fsType}
	      
	      
	        and fi_Stat = #{fiStat}
	      
	      ) tt where 1=1
	      
	        and tt.rowno >= #{startrow}
